  false,\n\t\"url\": null,\n\t\"notes\": \"Dataset contains monthly counts, from July
  2010 to present, of individuals receiving regular unemployment insurance benefits,
  as well as the amount of benefits received from New York State. Data are provided
  for New York State counties, out-of-state residents, and unknown geography. Regular
  unemployment insurance includes: Unemployment Insurance (UI) Compensation, Compensation
  for Federal Employees (UCFE), Unemployment Compensation for Ex-Service Members (UCX),
  Shared Work (SW) and Self Employment Assistance Program (SEAP).  It excludes federal
  extensions and 599.2 training.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
